    hints.ai_family = 0;
    hints.ai_socktype = SOCK_STREAM;
    hints.ai_flags = 1 | 4;
    hints.ai_protocol = IPPROTO_IP;
    if ((s = getaddrinfo(address, port, &hints, &result)) != 0) {
