    for (rp = result , i = 0; rp != ((void *)0) && i < 2; rp = rp->ai_next , ++i) {
        sock[i] = socket(rp->ai_family, rp->ai_socktype, rp->ai_protocol);
        if (sock[i] == -1) {
            perror("socket");
            continue;
        }
        v = 1;
        if (setsockopt(sock[i], 1, 2, &v, sizeof (v)) < 0) {
            perror("setsockopt");
            return -1;
        }
        if (bind(sock[i], rp->ai_addr, rp->ai_addrlen) < 0) {
            perror("socket");
            return -1;
        }
        if (listen(sock[i], 5) < 0) {
            perror("listen");
            return -1;
        }
